import React from 'react';
import Hero from '../components/Hero';
import Features from '../components/Features';
import Contact from '../components/Contact';
import Form from '../components/Form';

const Home = () => (
  <div>
    <Hero />
    <Features 
      title="Professional Experience"
      features={[
        {
          title: "Old Republic National Insurance Co - Automation Test Engineer",
          description: "*Creating and maintaining automation test suites, *developing custom C# tools, *implementing DevOps strategies, *integrating Cucumber, and *organizing defect meetings."
        },
        {
          title: "Old Republic National Insurance Co - Quality Assurance Test Analyst",
          description: "*Manual testing, *overseeing testing efforts, *acting as SME, and *training new team members."
        },
        {
          title: "Eagle Creek Software Services - Quality Assurance Analyst",
          description: "*Testing ETL workflows, *authoring test plans, *documenting procedures, *investigating customer problems, and *collaborating with field staff."
        }
      ]}
    />
    <Features 
      title="Professional Skills"
      features={[
        {
          title: "Programming Languages",
          description: "C#, MSSQL, VB, JS, TS, Java, Python"
        },
        {
          title: "Testing Tools",
          description: "Selenium, Appium, Browserstack, ReadyAPI, Postman, ADO/GIT CI workflow"
        },
        {
          title: "Other Tools",
          description: "UIPath, TestConnect, Json, HTML, CSS, Jenkins, NUnit, Web Design, Restful Services, VMWare, Node.js"
        }
      ]}
    />
    <Contact />
    <Form />
  </div>
);

export default Home;
